import { BrowserRouter, Route } from "react-router-dom";
import Login from './pages/login'
import Cadastro from "./pages/cadastro";

const Routes = () => {
    return(
        <BrowserRouter>
            <Route path="/" component={Login} />
        </BrowserRouter>
    )
}

export default Routes;
